import React from 'react'
import styles from './Order.css'

const Order = (props) => {
    let Ingredients
    return(
        <div className={styles.Order}>
        <p>Ingredients: Salad(2)</p>
        <p>Price: <strong>{Number.parseFloat(props.price).toFixed(2)} $</strong></p>
    </div>
    )
    
}


export default Order
